description:
Frozen (2010)  

Verenigde Staten
Thriller / Drama
94 minuten

geregisseerd door Adam Green
met Kevin Zegers, Shawn Ashmore en Emma Bell

Een snowboarder, zijn beste vriend en zijn vriendin, raken gestrand op een berg ergens in Nieuw-Engeland. Hulp hoeven ze niet te verwachten; het gebied is namelijk tijdelijk gesloten. Ze zullen nu moeten vechten om niet ten prooi te vallen aan een groep hongerige wolven, maar ook tegen de kou.

